import React, { useState } from 'react';
import { IonHeader, IonToolbar, IonButtons, IonButton, IonTitle, IonIcon, IonMenuButton, IonMenu, IonContent, IonItem, IonList, IonLabel} from '@ionic/react';
import '../css/Menu.css';
import '../css/Global.css';
import { arrowBackOutline, heart } from 'ionicons/icons';

const Menu: React.FC = props => {

    return(
        <IonMenu side="end" contentId="menuContent" menuId="first" id="menu" color="red">
            <IonContent id="menuContent">
                <IonList id="menuList">
                    <IonItem>
                        <IonIcon icon={heart} slot="start"></IonIcon>
                        <IonLabel>Favorites</IonLabel>
                    </IonItem>
                    <IonItem>Menu Item</IonItem>
                    <IonItem>Menu Item</IonItem>
                    <IonItem>Menu Item</IonItem>
                    <IonItem>Menu Item</IonItem>
                </IonList>
            </IonContent>
        </IonMenu>
    );
}

export default Menu;
